import "../style/HomeSlideBanner.css";
import pecel from "../asset/pecel.jpg";
import sushi from "../asset/sushi.jpg";
import pizza from "../asset/pizza.jpg";
import { Slider } from "@chakra-ui/react";

const HomeSlideBanner = () => {
  const settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1,
    autoplay: true,
    autoplaySpeed: 1000,
  };
  return (
    <div className="container-banner">
      <Slider {...settings} className="box-banner">
        <div className="item">
          <img src={pecel} alt="pecel" />
        </div>
        <div className="item">
          <img src={sushi} alt="sushi" />
        </div>
        <div className="item">
          <img src={pizza} alt="pizza" />
        </div>
      </Slider>
    </div>
  );
};

export default HomeSlideBanner;
